import React, { Component } from 'react';
import ImovelMarker from './ImovelMarker';

class ImovelMarkers extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        var renderImoveis = [];
        console.log(this.props.imoveisData);
        for (var i = 0; i < this.props.imoveisData.length; i++) {
            renderImoveis.push(<ImovelMarker condominio={this.props.imoveisData[i].condominio} rua={this.props.imoveisData[i].rua} 
                numero={this.props.imoveisData[i].numero} bairro={imovel.bairro} lat={imovel.lat} lng={imovel.lng}/>);
        }
        // this.props.imoveisData.array.forEach(imovel => {
        //     renderImoveis.push(<ImovelMarker condominio={imovel.condominio} rua={imovel.rua} numero={imovel.numero} 
        //                         bairro={imovel.bairro} lat={imovel.lat} lng={imovel.lng}/>);
        // });

        return (
            { renderImoveis }
        );
    }
}

export default ImovelMarkers;
